import backImage from "../../Assets/overlay.png";

const About = () => {
  return (
    <>
      <Slider
        backImg={backImage}
        currentPage={"About Us"}
        currentLink={"about"}
      />
      <Fun />
      <Istory />
      <Faq />
    </>
  );
};

export default About;
